import React from 'react';


function Profile(props) {

return(
    <div className="flex-container">
        <h1>Profile Page</h1>
        <h3>Name: {props.name}</h3>
        <img src = {props.img} />
        <p>Current City: {props.city}</p>

    </div>

)
}

export default Profile;
